import { Switch, Route, Redirect } from "react-router-dom";
import Home from "./Home";
import Contact from "./Contact";
import Menu from "./Menu";
import User from "./User";
import Searchimg from "./Searchimg";
import Error from "./Error";


const App = ()=>{
  return(
    <>
      <Menu />
      <Switch>
        <Route exact path="/" component={Home} />
        <Route exact path="/contact" render={()=> <Contact msg="everything is OK?"/>} />
        <Route exact path="/contact/about" component={()=>{
          return <h1> About in Contact </h1>;
        }} />
        <Route exact path="/user/:fname/:lname" component={User}/>
        <Route exact path="/search" component={Searchimg} />
        {/* <Route component={Error} /> */}
        <Redirect to="/" />
      </Switch>
    </>
  )
}



export default App;


